// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./CreatorToken.sol"; // Import the CreatorToken contract

contract CreatorTokenManager is Ownable (msg.sender) {
    struct Tier {
        string name;       // Name of the tier (e.g., Bronze, Silver, Gold)
        uint256 supply;    // Maximum supply for the tier
        uint256 minted;    // Number of tokens minted for the tier
        uint256 price;     // Price per token in the tier (in wei)
    }

    // Mapping from creator address to token contract
    mapping(address => address) public creatorTokens;
    // Mapping from token contract to tier metadata
    mapping(address => mapping(uint256 => Tier)) public tokenTiers;

    // Event for token contract creation
    event TokenCreated(address indexed creator, address tokenAddress);
    // Event for tier added
    event TierAdded(address indexed token, uint256 tierId, string name, uint256 supply, uint256 price);
    // Event for minting tokens
    event TokensMinted(address indexed token, address indexed recipient, uint256 tierId, uint256 amount);
    // Event for burning tokens
    event TokensBurned(address indexed token, address indexed creator, uint256 amount);

    function createToken(string memory name, string memory symbol) external {
        require(creatorTokens[msg.sender] == address(0), "Token already created");
        address newToken = address(new CreatorToken(name, symbol, msg.sender));
        creatorTokens[msg.sender] = newToken;
        emit TokenCreated(msg.sender, newToken);
    }

    function addTier(address token, uint256 tierId, string memory name, uint256 supply, uint256 price) external {
        require(creatorTokens[msg.sender] == token, "Not your token");
        require(tokenTiers[token][tierId].supply == 0, "Tier already exists");
        tokenTiers[token][tierId] = Tier({
            name: name,
            supply: supply,
            minted: 0,
            price: price
        });
        emit TierAdded(token, tierId, name, supply, price);
    }

    function mintTokens(address token, uint256 tierId, uint256 amount, address recipient) external payable {
        require(creatorTokens[msg.sender] == token, "Not your token");
        Tier storage tier = tokenTiers[token][tierId];
        require(tier.supply > 0, "Tier does not exist");
        require(tier.minted + amount <= tier.supply, "Exceeds tier supply");
        require(msg.value >= tier.price * amount, "Insufficient payment");
        tier.minted += amount;
        CreatorToken(token).mint(recipient, amount);
        emit TokensMinted(token, recipient, tierId, amount);
    }

    function burnTokens(address token, uint256 amount) external {
        require(creatorTokens[msg.sender] == token, "Not your token");
        CreatorToken(token).burn(msg.sender, amount);
        emit TokensBurned(token, msg.sender, amount);
    }

    // Function to get the token address for a creator
    function getTokenAddress(address creatorAddress) public view returns (address) {
        return creatorTokens[creatorAddress];
    }
}

contracts/MarketPlace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface IERC721Mintable is IERC721 {
    function mint(address to, string memory metadataURI) external returns (uint256);
}


contract NFTMarketplace {
    using SafeERC20 for IERC20;  // Using SafeERC20 for safe token transfers
    IERC20 public token;  // Reference to the ERC-20 token
    IERC721Mintable public nftContract;  // Reference to the ERC-721 NFT contract

    uint256 public marketplaceFee = 2;  // 2% marketplace fee
    address public feeRecipient;

    struct Auction {
        uint256 tokenId;
        uint256 highestBid;
        address highestBidder;
        uint256 endTime;
    }

    mapping(uint256 => uint256) public nftPrice;
    mapping(uint256 => address) public nftSeller;
    mapping(uint256 => Auction) public nftAuctions;
    mapping(uint256 => string) public nftUpgrades;

    event NFTListed(uint256 indexed tokenId, uint256 price, address seller);
    event NFTSold(uint256 indexed tokenId, address buyer, uint256 price);
    event NFTUpgraded(uint256 indexed tokenId, string newMetadata);
    event AuctionStarted(uint256 indexed tokenId, uint256 startingBid, uint256 endTime);
    event BidPlaced(uint256 indexed tokenId, address bidder, uint256 bidAmount);
    event AuctionEnded(uint256 indexed tokenId, address winner, uint256 finalBid);

    constructor(address _nftContract, address _token, address _feeRecipient) {
        nftContract = IERC721Mintable(_nftContract);
        token = IERC20(_token);
        feeRecipient = _feeRecipient;
    }

    modifier onlyOwner(uint256 tokenId) {
        require(nftContract.ownerOf(tokenId) == msg.sender, "Only owner can perform this action");
        _;
    }

    modifier auctionEnded(uint256 tokenId) {
        require(block.timestamp >= nftAuctions[tokenId].endTime, "Auction not yet ended");
        _;
    }

    // Mint and list NFT for sale
    function mintAndListNFT(string memory metadataURI, uint256 price) public returns (uint256) {
        uint256 tokenId = nftContract.mint(msg.sender, metadataURI);
        listNFTForSale(tokenId, price);
        return tokenId;
    }

    // List NFT for sale at a specific price
    function listNFTForSale(uint256 tokenId, uint256 price) public onlyOwner(tokenId) {
        nftPrice[tokenId] = price;
        nftSeller[tokenId] = msg.sender;
        emit NFTListed(tokenId, price, msg.sender);
    }

    // Buy NFT using ERC-20 token
    function buyNFT(uint256 tokenId) public {
        uint256 price = nftPrice[tokenId];
        address seller = nftSeller[tokenId];
        require(price > 0, "NFT not for sale");
        uint256 fee = (price * marketplaceFee) / 100;
        uint256 sellerAmount = price - fee;

        // Transfer fee to marketplace and the rest to the seller
        token.safeTransferFrom(msg.sender, feeRecipient, fee);  // Using SafeERC20
        token.safeTransferFrom(msg.sender, seller, sellerAmount);  // Using SafeERC20

        // Transfer NFT ownership
        nftContract.transferFrom(seller, msg.sender, tokenId);

        // Reset sale data
        nftPrice[tokenId] = 0;
        nftSeller[tokenId] = address(0);
        emit NFTSold(tokenId, msg.sender, price);
    }

    // Start an auction for an NFT
    function startAuction(uint256 tokenId, uint256 startingBid, uint256 duration) public onlyOwner(tokenId) {
        require(nftPrice[tokenId] == 0, "NFT already listed for sale");
        nftAuctions[tokenId] = Auction({
            tokenId: tokenId,
            highestBid: startingBid,
            highestBidder: address(0),
            endTime: block.timestamp + duration
        });
        emit AuctionStarted(tokenId, startingBid, block.timestamp + duration);
    }

    // Place a bid on an auction
    function placeBid(uint256 tokenId, uint256 amount) public {
        Auction storage auction = nftAuctions[tokenId];
        require(block.timestamp < auction.endTime, "Auction ended");
        require(amount > auction.highestBid, "Bid must be higher than the current bid");

        // Refund the previous highest bidder
        if (auction.highestBidder != address(0)) {
            token.safeTransfer(auction.highestBidder, auction.highestBid);
        }

        // Transfer the bid amount from the bidder
        token.safeTransferFrom(msg.sender, address(this), amount);

        auction.highestBid = amount;
        auction.highestBidder = msg.sender;
        emit BidPlaced(tokenId, msg.sender, amount);
    }

    // End auction and transfer the NFT to the highest bidder
    function endAuction(uint256 tokenId) public auctionEnded(tokenId) {
        Auction storage auction = nftAuctions[tokenId];
        address winner = auction.highestBidder;
        uint256 finalBid = auction.highestBid;

        if (winner != address(0)) {
            // Calculate fees and transfer funds
            uint256 fee = (finalBid * marketplaceFee) / 100;
            uint256 sellerAmount = finalBid - fee;

            // Transfer fee to marketplace and the rest to the seller
            token.safeTransfer(feeRecipient, fee);
            token.safeTransfer(nftSeller[tokenId], sellerAmount);

            // Transfer NFT ownership
            nftContract.transferFrom(nftSeller[tokenId], winner, tokenId);
        } else {
            // If no bids were placed, reset auction data
            delete nftAuctions[tokenId];
        }

        emit AuctionEnded(tokenId, winner, finalBid);
    }

    // Upgrade NFT metadata
    function upgradeNFT(uint256 tokenId, string memory newMetadata) public onlyOwner(tokenId) {
        nftUpgrades[tokenId] = newMetadata;
        emit NFTUpgraded(tokenId, newMetadata);
    }

    // Allow users to buy NFTs using tokens
    function buyNFTWithToken(uint256 tokenId, uint256 amount) public {
        uint256 price = nftPrice[tokenId];
        require(amount >= price, "Insufficient token balance");
        uint256 fee = (price * marketplaceFee) / 100;
        uint256 sellerAmount = price - fee;

        // Transfer fee to marketplace and the rest to the seller
        token.safeTransferFrom(msg.sender, feeRecipient, fee);  // Using SafeERC20
        token.safeTransferFrom(msg.sender, nftSeller[tokenId], sellerAmount);  // Using SafeERC20

        // Transfer NFT ownership
        nftContract.transferFrom(nftSeller[tokenId], msg.sender, tokenId);

        // Reset sale data
        nftPrice[tokenId] = 0;
        nftSeller[tokenId] = address(0);
        emit NFTSold(tokenId, msg.sender, price);
    }

    // Set marketplace fee (only fee recipient can change)
    function setMarketplaceFee(uint256 newFee) external {
        require(msg.sender == feeRecipient, "Only fee recipient can change fee");
        marketplaceFee = newFee;
    }

    // Set new fee recipient (only fee recipient can change)
    function setFeeRecipient(address newFeeRecipient) external {
        require(msg.sender == feeRecipient, "Only fee recipient can change");
        feeRecipient = newFeeRecipient;
    }
}

